	wJQ('#streamCRM__callback__callback__form, #streamCRM__modal__callback__form, #streamCRM__callback__callback__form_w').on('submit', function (e) {
		e.preventDefault();

		var data = wJQ(this).serializeArray();
		var result = {};
		var additionalData = {};

		for (var i = 0; i < data.length; i++) {
			if (['widget_id', 'widget_type', 'item_type', 'phone_number'].includes(data[i].name)) {
				result[data[i].name] = data[i].value;
			} else {
				additionalData[data[i].name] = data[i].value;
			}
		}

		// Form the correct "time" field
		if (additionalData['hours'] !== undefined && additionalData['minutes'] !== undefined) {
			additionalData['time'] = additionalData['hours'] + ':' + additionalData['minutes'];
		}

		// Set correct "day" field


		result['additional_data'] = JSON.stringify(additionalData);
		result['item_type'] = (additionalData["day"] !== undefined) ? 'queue' : 'callback';

		if (result['phone_number'].length <= 5) {
			console.log("Phone number is not valid!")
			return
		}

		var selectedDay = wJQ('#streamCRM__modal__callback__form > div.form__inputs.hidden > div.form__input.day__select > div > div > span');

		var selectedDayText = '';
		if (selectedDay.length > 0) {
			selectedDayText = selectedDay[0].innerText;
		}

		result['selected_day'] = selectedDayText;

		result['site_name'] = encodeURIComponent(location.host);
		result['site_page_href'] = encodeURIComponent(location.href);

		var cookies = arrayOfCookies();

		if (cookies['_ga'] !== undefined) {
			result['google_ga'] = cookies['_ga'];
		}

		if (cookies['_gid'] !== undefined) {
			result['google_gid'] = cookies['_gid'];
		}

		if (cookies['_fbp'] !== undefined) {
			result['facebook_fbp'] = cookies['_fbp'];
		}

		var utm = arrayOfUTM();
		if (utm.length > 0) {
			result['utm'] = utm.join('; ');
		}

		var xhr = new XMLHttpRequest();
		xhr.withCredentials = true;

		xhr.addEventListener("readystatechange", function () {
			if (this.readyState === 4) {
				console.log(this.responseText);
			}
		});

		xhr.open("POST", '../sand.php');
		xhr.setRequestHeader("Content-Type", "application/json");

		var jsonResult = JSON.stringify(result);

		console.log('Sending this data: ' + jsonResult);

		xhr.onreadystatechange = function () {
			if (xhr.readyState == XMLHttpRequest.DONE && xhr.status == 405) {
				var json = JSON.parse(xhr.response);
				afterSubmitCalbackForm(json);
			}
		}

		xhr.send(jsonResult);

		if (typeof gaStreamTelecom !== 'undefined') {


		}
	});

